import React from "react";

const BookTable = () => {
  return (
    <section>
      <div>img</div>
      <div>
        <h3>BOOK A TABLE</h3>
        <span>~ Check out our place ~</span>
        <form>
          <div>
            <select>
              <option>1</option>
              <option>2</option>
              <option>3</option>
              <option>4</option>
              <option>5</option>
            </select>
          </div>
        </form>
      </div>
    </section>
  );
};

export default BookTable;
